class Solution(object):
    def smallestDistancePair(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """
        nums.sort()
        self.nums = nums
        self.length = length = len(nums)
        smallValue = float('inf')
        for i in xrange(length-1):
            smallValue = min(smallValue, nums[i+1]-nums[i])
        maxValue = nums[-1] - nums[0]
# =============================================================================
#         if k == 1:
#             return smallValue
#         elif k == length * (length - 1) // 2:
#             return maxValue
# =============================================================================
        while maxValue > smallValue:
            middle = (maxValue - smallValue) // 2 + smallValue
            temp1 = self.count(middle)
            # this is wired
# =============================================================================
#             if temp1 == k:
#                 return middle
# =============================================================================
            if temp1 >= k:
                maxValue = middle
            else:
                smallValue = middle + 1
        return smallValue
            
            
    def count(self, target):
        count1 = 0
        for i in xrange(self.length-1):
            count1 += self.helper1(i, target)
        return count1
            
            
    def helper1(self, i, target):
        left = i + 1
        if self.nums[left] - self.nums[i] > target:
            return 0
        right = self.length-1
        if self.nums[right] - self.nums[i] <= target:
            return self.length - i - 1
        if self.nums[right] - self.nums[i] > target and self.nums[right-1] - self.nums[i] <= target: # new added, check
            return self.length - i - 2
        while left < right:
            middle = (left + right) // 2
            if self.nums[middle] - self.nums[i] > target and self.nums[middle-1] - self.nums[i] <= target:
                return middle - i - 1
            elif self.nums[middle] - self.nums[i] <= target:
                left = middle
            else:
                right = middle

